import {Pokemon} from "../model/Pokemon";
import * as React from "react";

interface IProps {
    pokemonList: Pokemon[]
}

export function PokemonList(props: IProps) {

    return (
        <div style={{backgroundColor:"powderblue", height:100}}>
            <table>
                <thead>
                <tr>
                    <th>#</th>
                    <th>Name</th>
                    <th>Types</th>
                    <th>Weight</th>
                </tr>
                </thead>
                <tbody>
                {props.pokemonList.map(pokemon => (
                    <tr>
                        <td>{pokemon.id}</td>
                        <td>{pokemon.name}</td>
                        <td>{pokemon.types.map(t => t.name).join(" ")}</td>
                        <td>{pokemon.weight}</td>
                    </tr>
                ))}
                </tbody>
            </table>
        </div>
    )

}
